Measurement.Details.SummaryText.Signal.B:
Þann {date}, sýndi prófun á [Signal forritinu](https://signal.org/) presented signs of blocking on {network} in {country}. merki um hindranir á {network} í landinu {country}

Þetta gæti þýtt að lokað hafi verið á Signal, en hinsvegar er möguleiki á að um [falska viðvörun](https://ooniorg/support/faq/#why-do-false-positives-occur) sé að ræða.

Endilega yfirfarðu netmælingagögnin hér fyrir neðan. Skoðaðu aðrar mælingar á Signal af sama netkerfi á þessu sama tímabili (ef þær liggja fyrir).

